class SecurityUtils {
    static encrypt(data) {
        try {
            return AES.encrypt(JSON.stringify(data), 'key').toString();
        }
        catch (e) {
            Error(e);
        }
    }
    static decrypt(data) {
        try {
            const bytes = AES.decrypt(data, 'key');
            if (bytes.toString()) {
                return JSON.parse(bytes.toString(enc.Utf8));
            }
            return data;
        }
        catch (e) {
            Error(e);
        }
    }
}

